        };
        render() {
            return (<CalendarContext.Consumer>
          {context => <WrappedComponent ref={this.saveRef} context={context} {...this.props}/>}
        </CalendarContext.Consumer>);
        }
    }
    hoistNonReactStatic(CalendarConsumer, WrappedComponent);
    return CalendarConsumer;
}
